import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faArrowRightLong } from '@fortawesome/free-solid-svg-icons'
import Button from "./Button"
import "./activewalkrequest.css"

function ActiveWalkRequest({ requester, from, to }) {
    // distance from requester ? maybe with a location api if those exist
    // profile picture? if we implement that?
    return (
        <div class="container">
            <p>{requester}</p>
            <div>
                <p class="stacked">{from}</p>
                <FontAwesomeIcon icon={faArrowRightLong} />
                <p class="stacked">{to}</p>
            </div>
            <Button text="Offer a walk" color="orange" class="item" />
        </div>
    )
}

export default ActiveWalkRequest
